import React, { useState, useEffect } from 'react';
import {
  Bell,
  MessageSquare,
  User,
  ChevronRight,
  Calendar,
  FileCheck,
  AlertCircle,
  Clock,
  BookOpen,
  Plane
} from 'lucide-react';

const StudentDashboard = () => {
    const [notifications, setNotifications] = useState([]);
    const [priorityTasks, setPriorityTasks] = useState([]);
    const [applicationStages, setApplicationStages] = useState([]);
    const user = 'Richard Pokhrel'; // Dynamically fetched or passed as a prop


    const fetchData = async () => {
      setLoading(true);

      try {
        const [notificationsResponse, priorityTasksResponse, applicationStagesResponse] = await Promise.all([
          fetch('http://127.0.0.1:8000/priority-task/'),
          fetch('http://127.0.0.1:8000/recent-updates/'),
          fetch('http://127.0.0.1:8000/application-stages/'),
        ]);

        notificationsData = notificationsResponse.json();
        priorityTaskData = priorityTasksResponse.json();
        applicationStagesData = applicationStagesResponse.json();

        setNotifications(notificationsData.recent - updates);
        setPriorityTasks(priorityTaskData.priority - task);
        setApplicationStages(applicationStagesData)

      } catch (error) {
        console.error('Error fetching data:', error);
        setError('Failed to fetch data');  // Set error message if the fetch fails
      } finally {
        setLoading(false);  // Set loading to false after data is fetched or an error occurs
      }
    };
  const iconsMap = [
    { 'Applications Submitted': <FileCheck className="w-5 h-5 text-blue-500" /> },
    { 'Offers Received': <MessageSquare className="w-5 h-5 text-green-500" /> },
    { 'Pending Documents': <Clock className="w-5 h-5 text-orange-500" /> },
    { 'Visa Applications': <Plane className="w-5 h-5 text-purple-500" /> }
  ];

  return (
    <div className="p-6 bg-gray-50 min-h-screen">
      {/* Header Section */}
      <div className="flex items-center justify-between mb-6 m-5">
        <div>
          <h1 className="text-2xl font-bold">Hi, {user}!</h1>
          <p className="text-gray-600">Welcome back, we're happy to have you here!</p>
        </div>
        <div className="flex items-center gap-4">
          <Bell className="w-6 h-6 text-gray-600 cursor-pointer" />
          <User className="w-6 h-6 text-gray-600 cursor-pointer" />
        </div>
      </div>

      <div className="grid grid-cols-3 gap-6">
        {/* Application Progress */}
        <div className="col-span-2 bg-white rounded-lg shadow p-6">
          <h2 className="text-lg font-semibold mb-4">Application Progress</h2>
          <div className="grid grid-cols-4 gap-4">
            {applicationStages.map((stage, index) => (
              <div key={index} className="p-4 border rounded-lg">
                <div className="flex items-center justify-between mb-2">
                  {iconsMap[stage.label] || <File className="w-5 h-5 text-gray-500" />} {/* Fallback icon */}
                  <span className="text-2xl font-bold">{stage.count}</span>
                </div>
                <p className="text-sm text-gray-600">{stage.label}</p>
              </div>
            ))}
          </div>
        </div>

        {/* Quick Actions */}
        <div className="bg-white rounded-lg shadow p-6">
          <h2 className="text-lg font-semibold mb-4">Quick Actions</h2>
          <div className="space-y-3">
            <button className="w-full p-3 text-left border rounded-lg hover:bg-gray-50 flex items-center justify-between">
              <div className="flex items-center gap-3">
                <Calendar className="w-5 h-5 text-blue-500" />
                <span>Schedule Counseling</span>
              </div>
              <ChevronRight className="w-4 h-4 text-gray-400" />
            </button>
            <button className="w-full p-3 text-left border rounded-lg hover:bg-gray-50 flex items-center justify-between">
              <div className="flex items-center gap-3">
                <BookOpen className="w-5 h-5 text-green-500" />
                <span>View Universities</span>
              </div>
              <ChevronRight className="w-4 h-4 text-gray-400" />
            </button>
          </div>
        </div>

        {/* Priority Tasks */}
        <div className="col-span-2 bg-white rounded-lg shadow p-6">
          <h2 className="text-lg font-semibold mb-4">Priority Tasks</h2>
          <div className="space-y-4">
            {priorityTasks.map(task => (
              <div key={task.id} className="p-4 border rounded-lg">
                <div className="flex items-center justify-between mb-2">
                  <h3 className="font-medium">{task.title}</h3>
                  <span className="px-2 py-1 rounded text-xs">
                    {task.due_date}
                  </span>
                </div>
                <p className="text-sm text-gray-600">{task.info}</p>
              </div>
            ))}
          </div>
        </div>

        {/* Notifications */}
        <div className="bg-white rounded-lg shadow p-6">
          <h2 className="text-lg font-semibold mb-4">Recent Updates</h2>
          <div className="space-y-4">
            {notifications.map(notification => (
              <div key={notification.id} className="flex items-start gap-3 p-3 border-b last:border-0">
                <AlertCircle className="w-5 h-5 text-blue-500 flex-shrink-0 mt-1" />
                <div>
                  <p className="text-sm">{notification.title}</p>
                  <span className="text-xs text-gray-500">{notification.updateTime}</span>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );};

  useEffect(() => {
    fetchData(); // Runs on every render (not ideal)
  });

export default StudentDashboard;
